text:
@ladygaga has publicly apologised for working with r kelly and announced she is removing the pair's collaboration 'do what u want' from @itunes and other streaming services following the latest "horrifying and indefensible" allegations of sexual assault made against the r&b singer in new documentary 'surviving r kelly' - allegations kelly has denied. "i stand behind these women 1000%, believe them, know they are suffering and in pain", gaga said. "i'm sorry, both for my poor judgement when i was young, and for not speaking out sooner."
